  return (
    <div>
      <a href="/blog">Static Generation with Data example</a> <br /><br />
      <a href="/catchAllRoutes">Catch all routes</a> <br /><br />
      <a href="/posts/2">Catch all routes</a> <br /><br />
      <a href="/blueprintComponent">Blueprint library component</a>
    </div>
  );
}

